('2435','18','7947','Villa Jaime',Null,'Einfamilienhaus zum renovieren in El Toro','34165','El Toro liegt in der Gemeinde Calvia im Südwesten Mallorcas. Von hier aus sind es nur wenige Fahrminuten zu mehreren Golfplätzen, Marinas, Supermärkten ect. Das Haus wurde 1976 erstellt und steht auf einem flachen 1000m ² großen Grundstück. Es benötigt eine komplette Renovierung. Die 215m² Wohnfläche verteilt sich auf Wohn-Esszimmer, große Wohnküche mit Kamin, Hauswirtschaftsraum, 3 Schlafzimmer und 2 Badezimmer. Des Weiteren hat es über einen separaten Eingang noch ein Turmzimmer(Schlafzimmer) mit Küche, Bad und großer Terrasse. Im Außenbereich befinden sich noch ein Pool und ein Barbecue.','34166','610000','106','2016-03-15 16:19:39','106','2016-03-15 16:20:30',Null,'2581','88','1211',1,'1','0',Null,Null,Null,'34167',Null,'0','0','0',Null,'2016-03-15 16:26:53',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34168',Null,'34169',Null,'34170',Null,'34171',Null,'34172','0',0,'0');
